To create a React and Node.js/Express web app for creating or adding dummy data, showing it, and deploying it on Heroku or any other free platform, you can follow these steps:

1. Set up the project:
   - Create a new directory for your project.
   - Open a terminal and navigate to the project directory.
   - Run `npx create-react-app client` to create a new React app in a "client" directory.
   - Create a new directory named "server" for the backend code.

2. Set up the server:
   - Navigate to the "server" directory.
   - Run `npm init -y` to initialize a new Node.js project.
   - Install the necessary dependencies by running:
     ```
     npm install express cors
     ```
   - Create a new file named "server.js" and add the following code:
     ```javascript
     const express = require('express');
     const cors = require('cors');

     const app = express();
     app.use(cors());
     app.use(express.json());

     // Dummy data
     let data = [];

     // API endpoints
     app.get('/api/data', (req, res) => {
       res.json(data);
     });

     app.post('/api/data', (req, res) => {
       const newItem = req.body;
       data.push(newItem);
       res.status(201).json(newItem);
     });

     // Start the server
     const port = process.env.PORT || 5000;
     app.listen(port, () => {
       console.log(`Server is running on port ${port}`);
     });
     ```

3. Set up the client:
   - Navigate to the "client" directory.
   - Install the necessary dependencies by running:
     ```
     npm install axios
     ```
   - Update the "src/App.js" file with the following code:
     ```javascript
     import React, { useState, useEffect } from 'react';
     import axios from 'axios';

     function App() {
       const [data, setData] = useState([]);
       const [newItem, setNewItem] = useState('');

       useEffect(() => {
         fetchData();
       }, []);

       const fetchData = async () => {
         const response = await axios.get('/api/data');
         setData(response.data);
       };

       const handleSubmit = async (e) => {
         e.preventDefault();
         await axios.post('/api/data', { item: newItem });
         setNewItem('');
         fetchData();
       };

       return (
         <div>
           <h1>Dummy Data</h1>
           <ul>
             {data.map((item, index) => (
               <li key={index}>{item.item}</li>
             ))}
           </ul>
           <form onSubmit={handleSubmit}>
             <input
               type="text"
               value={newItem}
               onChange={(e) => setNewItem(e.target.value)}
             />
             <button type="submit">Add Item</button>
           </form>
         </div>
       );
     }

     export default App;
     ```

4. Configure proxy:
   - In the "client" directory, create a new file named "setupProxy.js" and add the following code:
     ```javascript
     const { createProxyMiddleware } = require('http-proxy-middleware');

     module.exports = function (app) {
       app.use(
         '/api',
         createProxyMiddleware({
           target: 'http://localhost:5000',
           changeOrigin: true,
         })
       );
     };
     ```

