TF = (Number of times the word appears in the text) / (Total number of words in the text)

For example, if the word "apple" appears 3 times in a text that contains 100 words, the TF for "apple" would be:

TF("apple") = 3 / 100 = 0.03

### Inverse Document Frequency (IDF)

IDF measures the importance of a word across a set of documents. It is calculated using the following formula:

IDF = log_e(Total number of documents / Number of documents containing the word)

For example, if the word "apple" appears in 10 out of 100 documents, the IDF for "apple" would be:

IDF("apple") = log_e(100 / 10) ≈ 2.3

### TF-IDF

The TF-IDF score is the product of the TF and IDF values:

TF-IDF = TF * IDF

Continuing with the previous example, the TF-IDF score for "apple" would be:

TF-IDF("apple") = 0.03 * 2.3 ≈ 0.069
